We mentioned that Chunked Array is just an array of Arrow arrays. Let’s actually look at what Arrow arrays are. PrimitiveArray is the Rust implementation of the Apache Arrow array. Conceptually, PrimitiveArray is an immutable Vec<Option<T>>. pub struct PrimitiveArray<T: NativeType> { data_type: DataType, values: Buffer<T>, validity: Option<Bitmap>,
} Buffer is a data structure that can be shared across threads and can be sliced and cloned in O(1) . The validity property stores whether each element in the array is null or not in a BitMap , which is semantically equivalent to Arc<Vec<bool>>. In other words, to initialize a PrimitiveArray, you need the data type, the raw values, and an array that specifies whether each element is null. For example: let primitive_array = PrimitiveArray::new( ArrowDataType::Float32, vec![12, 15, 16].into(), Some(vec![true, false, true].into())
); Now that we know what a ChunkedArray is, let’s look at how some of its operations are implemented.

